svg.script:
(function(){
  var SPOUSE = {"P_geh08": ["P_gehS01", "P_g5p07"], "P_gehS01": ["P_geh08"], "P_geh07": ["P_g5p04"], "P_g5p04": ["P_geh07"], "P_geh09": ["P_att38"], "P_att38": ["P_geh09"], "P_geh05": ["P_g4p04", "P_g4p01"], "P_g4p04": ["P_geh05"], "P_geh01": ["P_geh02"], "P_geh02": ["P_geh01"], "P_geh03": ["P_geh04"], "P_geh04": ["P_geh03"], "P_g4p06": ["P_geh06"], "P_geh06": ["P_g4p06"], "P_g4p01": ["P_geh05"], "P_g5p07": ["P_geh08"]};
  var FAMILY = {"M_gehF4": ["P_geh08", "P_gehS01"], "M_g5F2": ["P_geh07", "P_g5p04"], "M_gehF3": ["P_geh09", "P_att38", "P_geh01", "P_geh03"], "M_g4F2": ["P_geh05", "P_g4p04", "P_g4p05"], "M_gehF1": ["P_geh01", "P_geh02", "P_geh05", "P_geh06"], "M_gehF2": ["P_geh03", "P_geh04", "P_geh07", "P_geh08"], "M_g4F3": ["P_g4p06", "P_geh06", "P_g4p07", "P_g4p08", "P_g4p09"], "M_g4F1": ["P_geh05", "P_g4p01", "P_g4p02", "P_g4p03"], "M_g5F4": ["P_geh08", "P_g5p07", "P_g5p08", "P_g5p09", "P_g5p10"]};
  function clearHl(){ document.querySelectorAll('.blink').forEach(function(n){ n.classList.remove('blink'); n.classList.remove('highlight'); }); }
  function hl(id){ var el=document.getElementById(id); if(el){ el.classList.add('highlight'); el.classList.add('blink'); } }
  document.addEventListener('click', function(evt){
    var target = evt.target;
    var g = target.closest && target.closest('g[id^="P_"], g[id^="M_"]');
    if (!g) { while (target) { if (target.id && /^([PM]_)/.test(target.id) && target.tagName && target.tagName.toLowerCase() === 'g') { g = target; break; } target = target.parentNode; } }
    if (!g) return;
    var id = g.id; clearHl();
    if (/^P_/.test(id)) { (SPOUSE[id] || []).forEach(hl); }
    else if (/^M_/.test(id)) { hl(id); (FAMILY[id] || []).forEach(hl); }
  }, false);
})();
